import React from 'react';
import {Outlet} from 'react-router-dom'

function MainPage(){
    return(
        <div>
            <header className='bg-primary p-2'>
                <h1>Hola</h1>
                <h2>esto es el encabezado de la pagina</h2>
            </header>
            <div>
                <h3>esto es el cuerpo de la pagina</h3>
            </div>
            <div>
                <h3>esto es el pie de la pagina</h3>
            </div>
            <Outlet/>
        </div>
    )
}

export default MainPage;
